import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar';

export default function Dashboard() {
  const [resumo, setResumo] = useState(null);
  const [comunicacoes, setComunicacoes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [erro, setErro] = useState('');

  useEffect(() => {
    async function fetchDados() {
      setLoading(true);
      setErro('');
      try {
        const r1 = await fetch('http://localhost:8080/api/dashboard-resumo');
        const r2 = await fetch('http://localhost:8080/api/comunicacoes');
        const resumoData = await r1.json();
        const comunicacoesData = await r2.json();
        setResumo(resumoData);
        setComunicacoes(comunicacoesData);
      } catch (err) {
        setErro('Erro ao buscar dados do dashboard.');
      } finally {
        setLoading(false);
      }
    }
    fetchDados();
  }, []);

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-tl from-gray-600 via-gray-200 to-gray-100">
      <div className="w-full max-w-6xl mx-auto py-12 px-6">
        <Navbar />
        <h1 className="text-4xl font-bold text-blue-900 mb-10">Dashboard</h1>
        {loading && <div>Carregando...</div>}
        {erro && <div className="text-red-600 mb-4">{erro}</div>}
        {resumo && (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-12">
            <div className="bg-white rounded-xl shadow p-8 min-h-[120px] flex flex-col justify-center">
              <div className="text-gray-500 text-lg">Volume Analisado</div>
              <div className="text-3xl font-extrabold">R$ {resumo.volume_total?.toLocaleString('pt-BR')}</div>
            </div>
            <div className="bg-white rounded-xl shadow p-8 min-h-[120px] flex flex-col justify-center">
              <div className="text-gray-500 text-lg">Comunicações</div>
              <div className="text-3xl font-extrabold">{resumo.num_comunicacoes}</div>
            </div>
          </div>
        )}
        <div className="bg-white rounded-xl shadow p-8">
          <h2 className="text-2xl font-bold mb-6">Comunicações</h2>
          <table className="w-full bg-white border rounded text-base">
            <thead>
              <tr>
                <th className="px-8 py-4 border whitespace-nowrap text-lg">Titular</th>
                <th className="px-8 py-4 border whitespace-nowrap min-w-[160px] text-lg">CPF/CNPJ</th>
                <th className="px-8 py-4 border whitespace-nowrap min-w-[200px] text-lg">Banco</th>
                <th className="px-8 py-4 border whitespace-nowrap min-w-[200px] text-lg">Período</th>
                <th className="px-8 py-4 border whitespace-nowrap min-w-[140px] text-lg">Valor</th>
                <th className="px-8 py-4 border whitespace-nowrap text-lg">Ações</th>
              </tr>
            </thead>
            <tbody>
              {comunicacoes.map((c) => (
                <tr key={c.id} className="hover:bg-blue-50">
                  <td className="px-8 py-3 border whitespace-nowrap text-base">{c.titular}</td>
                  <td className="px-8 py-3 border whitespace-nowrap min-w-[160px] text-base">{c.cpf}</td>
                  <td className="px-8 py-3 border whitespace-nowrap min-w-[200px] text-base">{c.banco}</td>
                  <td className="px-8 py-3 border whitespace-nowrap min-w-[200px] text-base">{c.periodo ? `${c.periodo.inicio || ''} - ${c.periodo.fim || ''}` : '-'}</td>
                  <td className="px-8 py-3 border whitespace-nowrap min-w-[140px] text-base">R$ {c.valor?.toLocaleString('pt-BR')}</td>
                  <td className="px-8 py-3 border whitespace-nowrap">
                    <button className="bg-gray-400 text-white px-4 py-2 rounded cursor-not-allowed" disabled>Detalhes</button>
                  </td>
                </tr>
              ))}
              {comunicacoes.length === 0 && (
                <tr><td colSpan={6} className="text-center py-6 text-gray-500">Nenhuma comunicação encontrada.</td></tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
